import Head from 'next/head';
import AdminNavbar from './adminNavbar';

const AdminLayout = (props) => (
    <div>
        <Head>
            <title>
                Muhalik
            </title>

        </Head>
        <AdminNavbar />
        {props.children}
    </div>
);

export default AdminLayout;
